local LibBonusId = LibStub("LibBonusId") ---@type LibBonusId
local private = {
	linkData = {},
	runnerFrame = CreateFrame("Frame"),
	resumeFunc = nil,
	gotReplicateItemListUpdateEvent = false,
}
do
	for link in gmatch(LINK_DATA, "(.-)\r?\n") do
		link = strtrim(link)
		if link ~= "" then
			tinsert(private.linkData, link)
		end
	end
	private.runnerFrame:Hide()
	private.runnerFrame:SetScript("OnUpdate", function()
		if private.resumeFunc() then
			private.resumeFunc = nil
			private.runnerFrame:Hide()
		end
	end)
	private.runnerFrame:RegisterEvent("REPLICATE_ITEM_LIST_UPDATE")
	private.runnerFrame:SetScript("OnEvent", function(_, event)
		if event == "REPLICATE_ITEM_LIST_UPDATE" then
			private.gotReplicateItemListUpdateEvent = true
		end
	end)
end

function private.ItemLinksTestThread()
	local numErrors = 0
	print(format("Checking %d item links...", #private.linkData))
	for index, link in ipairs(private.linkData) do
		local itemId = tonumber(strmatch(link, "item:(%d+):"))
		local calculated = LibBonusId.CalculateItemLevelFromItemLink(link)
		local itemLevel = private.GetItemLevelFromTooltip(link)
		if itemLevel then
			if itemLevel == calculated then
				local bonusString = LibBonusId.GetBonusStringForLevel(calculated)
				if bonusString then
					local parts = strsplittable(":", bonusString)
					local numBonusIds = tonumber(parts[1])
					local bonusIds = {}
					for i = 1, numBonusIds do
						tinsert(bonusIds, tonumber(parts[i + 1]))
					end
					local modifierDropLevel = nil
					if numBonusIds ~= #parts + 1 then
						modifierDropLevel = strmatch(":9:(%d+)$", bonusString)
					end
					local calculated2 = LibBonusId.CalculateItemLevelFromItemInfo(itemId, bonusIds, modifierDropLevel)
					if calculated2 ~= calculated then
						print(format("[ERROR] Round-trip calculated an item level of %d, expected %d for %s (%s)", calculated2, calculated, link, bonusString))
					end
				else
					print(format("[ERROR] Could not get bonus string for level %d", calculated))
				end
			else
				if numErrors < 100 then
					print(format("[ERROR] Calculated an item level of %d, expected %d for %s", calculated, itemLevel, link))
				end
				numErrors = numErrors + 1
			end
		end
		if index % 1000 == 0 then
			print(format("Checked %d/%d links", index, #private.linkData))
			private.ThreadYield()
		end
	end
	print(format("Done checking links (%d errors)", numErrors))
	return true
end

function private.AuctionScanTestThread()
	print("Sending replicate query...")
	private.gotReplicateItemListUpdateEvent = false
	C_AuctionHouse.ReplicateItems()
	while not private.gotReplicateItemListUpdateEvent do
		private.ThreadYield()
	end

	local numResults = C_AuctionHouse.GetNumReplicateItems()
	print(format("Scanning %d replicate items...", numResults))
	local testedLink = {}
	for i = 0, numResults - 1 do
		local itemId = select(17, C_AuctionHouse.GetReplicateItemInfo(i))
		if itemId ~= 82800 and private.IsCommodity(itemId) == false then
			local link = private.GetReplicateLink(i)
			if link and select(15, strsplit(":", link)) ~= "" and not testedLink[link] then
				testedLink[link] = true
				local itemLevel = private.GetItemLevelFromTooltip(link)
				if itemLevel then
					local calculated = LibBonusId.CalculateItemLevelFromItemLink(link)
					if calculated ~= itemLevel then
						print(format("[ERROR] Calculated an item level of %d, expected %d for %s", calculated, itemLevel, link))
					end
				end
			end
		end
		if i % 1000 == 999 then
			print(format("Checked %d/%d auctions", i + 1, numResults))
			private.ThreadYield()
		end
	end
end

function private.GetItemLevelFromTooltip(link)
	for i = 1, 50 do
		for _, line in ipairs(C_TooltipInfo.GetHyperlink(link).lines) do
			if line.itemLevel then
				return line.itemLevel
			end
		end
		private.ThreadYield()
	end
	print(format("[WARNING] Giving up getting item level for link %s", link))
	return nil
end

function private.IsCommodity(itemId)
	for i = 1, 50 do
		local maxStackSize = select(8, C_Item.GetItemInfo(itemId))
		if maxStackSize ~= nil then
			return maxStackSize ~= 1
		end
		private.ThreadYield()
	end
	print(format("[WARNING] Giving up getting commodity status for item %d", itemId))
	return nil
end

function private.GetReplicateLink(index)
	for i = 1, 50 do
		local link = C_AuctionHouse.GetReplicateItemLink(index)
		if link then
			return link
		end
		private.ThreadYield()
	end
	print(format("[WARNING] Giving up getting replicate link for index %d", index))
	return nil
end

function private.ThreadedRetries(func, maxRetries)
	local result = nil
	for i = 1, maxRetries or math.huge do
		result = func()
		if result ~= nil then
			return result
		end
		private.ThreadYield()
	end
	return nil
end

function private.ThreadYield()
	return coroutine.yield(false)
end

function LibBonusIdTest(command)
	if command == "LINKS" then
		if private.resumeFunc then
			print("[ERROR] Already running!")
			return
		end
		private.resumeFunc = coroutine.wrap(private.ItemLinksTestThread)
		private.runnerFrame:Show()
	elseif command == "AH" then
		if private.resumeFunc then
			print("[ERROR] Already running!")
			return
		end
		private.resumeFunc = coroutine.wrap(private.AuctionScanTestThread)
		private.runnerFrame:Show()
	elseif command == "STOP" then
		if not private.resumeFunc then
			print("[ERROR] Not running!")
			return
		end
		private.runnerFrame:Hide()
		private.resumeFunc = nil
		print("Stopped test")
	else
		print("[ERROR] Unknown command (%s)", tostring(command))
	end
end
